INSERT INTO `smstemplate` (`TemplateID`, `TemplateName`, `TemplateContent`) VALUES
	(1, '会员登记', '尊敬的客户：恭喜您！您于{Time}成为本店会员，会员卡号为{CardID}，感谢您的光临！'),
	(2, '充值短信', '尊敬的客户：您尾号为{LCardID}的会员卡，于{Time}在本店充值{TempMoney}元，账户余额{Money}元，感谢您的光临！'),
	(3, '提现短信', '尊敬的客户：您尾号为{LCardID}的会员卡，于{Time}在本店提现{TempMoney}元，账户余额{Money}元，感谢您的光临！'),
	(4, '积分兑换', '尊敬的客户：您尾号为{LCardID}的会员卡，于{Time}在本店花费{TempPoint}分兑换礼品，账户剩余{Point}分，感谢您的光临！'),
	(5, '消费短信', '尊敬的客户：您尾号为{LCardID}的会员卡，于{Time}在本店消费{TempMoney}元，本次积分{TempPoint}分，账户积分为{Point}，账户余额：{Money}感谢您的光临！'),
	(6, '等级短信', '尊敬的客户：恭喜您！您尾号为{LCardID}的会员卡，于{Time}在本店从{OldLevel}会员变为{NewLevel}会员。'),
	(7, '积分变动', '尊敬的客户：您尾号为{CardID}的会员卡号,于{Time}在本店积分变动{TempPoint},账户剩余积分为{Point}。'),
	(8, '消费撤单', '尊敬的客户：您尾号为：{LCardID}的会员卡，于{Time}在本店撤单，金额{TempMoney}元，撤单积分{TempPoint}，账户余额{Money}元，账户积分{Point}，感谢您的光临！'),
	(9, '消费退货', '尊敬的客户：您尾号为：{LCardID}的会员卡，于{Time}在本店退货，金额{TempMoney}元，退货积分{TempPoint}，账户余额{Money}元，账户积分{Point}，感谢您的光临！'),
	(10, '会员生日', '尊敬的{Name}：你的生日{MemBirthday}就要到了，在此送给您最真挚的祝福！'),
	(11, '会员到期', '尊敬的客户：您尾号为{LCardID}的会员卡,将于{MemPastTime}过期，当前账户余额{Money}元，账户积分{Point}，请及时续期或充值！'),
	(12, '计次消费', '尊敬的客户：您尾号为{LCardID}的会员卡，于{Time}在本店进行进行计次消费{TempGoodsItem}，感谢您的光临！');
