-- 导出  函数 hyxt.getChildList 结构
DROP FUNCTION IF EXISTS `getChildList`;
DELIMITER //
CREATE DEFINER=`root`@`localhost` FUNCTION `getChildList`(rootId INT) RETURNS varchar(1000) CHARSET utf8
BEGIN
DECLARE sTemp VARCHAR(1000); 
DECLARE sTempChd VARCHAR(1000);  
  
   SET sTemp = '$';  
   SET sTempChd =cast(rootId as CHAR);  
  
   WHILE sTempChd is not null DO  
     SET sTemp = concat(sTemp,',',sTempChd);  
     SELECT group_concat(id) INTO sTempChd FROM treeNodes where FIND_IN_SET(pid,sTempChd)>0;  
   END WHILE;  
   RETURN sTemp;  
 END//
DELIMITER ;


-- 导出  函数 hyxt.getmemcountnumber 结构
DROP FUNCTION IF EXISTS `getmemcountnumber`;
DELIMITER //
CREATE DEFINER=`root`@`%` FUNCTION `getmemcountnumber`(`goodsid` INT, `memid` INT) RETURNS int(11)
    COMMENT '获取最近时间的充次记录'
BEGIN
	declare num int;
	declare memcounttotalnumber int;
	select count(countdetailtotalnumber) into num from memcountdetail where memcountdetail.goodsid=goodsid 
	and memcountdetail.CountDetailMemID=memid;
	if num>0 then
		select CountDetailTotalNumber into memcounttotalnumber  from memcountdetail where countdetailid =(
select max(countdetailid) from memcountdetail where memcountdetail.goodsid=goodsid 
and memcountdetail.CountDetailMemID=memid
);
		return memcounttotalnumber;
		end if ;
	return 0;
	
END//
DELIMITER ;


-- 导出  函数 hyxt.getmemid 结构
DROP FUNCTION IF EXISTS `getmemid`;
DELIMITER //
CREATE DEFINER=`root`@`%` FUNCTION `getmemid`(`in_memcard` VARCHAR(50)  charset utf8) RETURNS int(11)
    COMMENT '通过会员卡号查会员ID'
BEGIN
	declare v_memid int;
  select max(mem.memid) into v_memid from mem where mem.memcard = in_memcard;
 	
	return v_memid;
END//
DELIMITER ;


-- 导出  函数 hyxt.getWeixinMenu 结构
DROP FUNCTION IF EXISTS `getWeixinMenu`;
DELIMITER //
CREATE DEFINER=`root`@`localhost` FUNCTION `getWeixinMenu`(rootId INT) RETURNS varchar(1000) CHARSET utf8
BEGIN
DECLARE sTemp VARCHAR(1000); 
DECLARE sTempChd VARCHAR(1000);  
  
   SET sTemp = '$';  
   SET sTempChd =cast(rootId as CHAR);  
  
   WHILE sTempChd is not null DO  
     SET sTemp = concat(sTemp,',',sTempChd);  
     SELECT group_concat(menuid) INTO sTempChd FROM weixinmenu where FIND_IN_SET(parentMenuId,sTempChd)>0;  
   END WHILE;  
   RETURN sTemp;  
 END//
DELIMITER ;


