-- 导出  过程 hyxt.pro_cre_childlist 结构
DROP PROCEDURE IF EXISTS `pro_cre_childlist`;
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `pro_cre_childlist`(IN `rootId` INT, IN `nDepth` INT)
BEGIN   
      DECLARE done INT DEFAULT 0;   
      DECLARE b INT;   
      declare c int;
      DECLARE cur1 CURSOR FOR SELECT MenuID FROM weixinmenu WHERE parentMenuID=rootId;
      
      DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;   
      SET max_sp_recursion_depth=12;   
      
      select count(*) into c from weixinmenu WHERE parentMenuID=rootId;
       
       
      OPEN cur1;   
       
      FETCH cur1 INTO b;   
      WHILE done=0 DO   
              CALL pro_cre_childlist(b,nDepth+1);   
              FETCH cur1 INTO b;   
      END WHILE;   
       
      CLOSE cur1;   
END//
DELIMITER ;


-- 导出  过程 hyxt.pro_show_weixinmenu 结构
DROP PROCEDURE IF EXISTS `pro_show_weixinmenu`;
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `pro_show_weixinmenu`(IN `rootId` INT)
BEGIN   
      DROP TEMPORARY TABLE IF EXISTS tmpLst;   
      CREATE TEMPORARY TABLE IF NOT EXISTS tmpLst    
       (sno INT PRIMARY KEY AUTO_INCREMENT,id INT,depth INT,childnum int);         
       
      CALL pro_cre_childlist(rootId,0);   
       
      SELECT weixinmenu.MenuID,CONCAT(if(tmpLst.depth>1,'----',''),weixinmenu.MenuName) MenuName,weixinmenu.parentMenuID,weixinmenu.MenuUrl,weixinmenu.MenuType,weixinmenu.MenuKey,tmpLst.childnum
      FROM tmpLst,weixinmenu WHERE tmpLst.id=weixinmenu.MenuID ORDER BY tmpLst.sno;   
     END//
DELIMITER ;


